const Tampapp = () => {
    const [city, setcity] = useState(null);
    const [search, setsearch] = useState("mumbai");


    useEffect(() => {
      const fetchApi = async () => {
        const url = `https://api.openweathermap.org / data / 2.5 / weather ? q = ${search} &appid=02bea7dbe89e9910a08ef9552d0159e3`;
        const response = await fetch(url);
        const resJson = await response.json();
        setcity(resJson);
      };

      fetchApi();
    }, [setsearch]);

